import "./App.css";
import HomePage from './HomePage';
import {BrowserRouter as Router, Route , Switch} from 'react-router-dom';

function App() {



  return (
    <div className="App">
      <Router>
        <Switch>
          <Route exact path="/" component={HomePage} />
          <Route exact path="/:city" component={HomePage} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
